    false,nt"url": null,nt"notes": "This Inventory and Monitoring Plan for
    Clarence Cannon and Great River National Wildlife Refuges is a step-down from the
    Habitat Management Plan (HMP) and documents the inventory and monitoring surveys
    that will be conducted from 2013 through 2028, or until the refugeu2019s Comprehensive
    Conservation Plan and HMP are revised. The majority of surveys considered in this
    plan address resource management objectives identified in the HMP (2012) for these
    refuges. Other surveys are a continuation of past monitoring conducted for the purpose
    of understanding long-term trends in specific resources or are part of regional
    and national survey efforts.",nt"license_title": "License Not Specified",nt"extras":
